  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<H />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </div>
    </Router>
  );
}
